import "./ExpenseItem.css";

function ExportItem() {
  return (
    <div>
      <div className='expense-item'>March 28th 2021</div>
      <div className='expense-item__description'>
        <h2>Car Insurance</h2>
        <div className='expense-item__price'>$ 330</div>
      </div>
    </div>
  );
}

export default ExportItem;
